import React, { Component } from "react";

export default class Article extends Component {
    render()
    {
        return(
            <article>
                <ul>
                    <li className="logo_gta"></li>
                    <li className="tit">Reaper</li> <br></br>
                </ul>
            </article>
        )
    }
}
